import React from 'react';

import { Link } from 'react-router-dom'; 

import Signin from '../Sign-in/SignIn';
import Register from '../Sing-up/SignUp';
import Forget from '../Forget-password/Password';
import Password from '../Forget-password/Password';

import LoginNavbar from '../Login-navbar/LoginNavbar';
import Copyright from '../Copyright/Copyright';

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
function Login() {
    const navItems =[
        {name: 'Login', path:'/Login'},
        {name: 'Signup', path:'/Signup'},
        {name: 'Forget', path:'/Forget'},


    ]
    return (


<Router>
<div>
  <Routes>
    <Route path="/Login" element={<><LoginNavbar /><Login /><Copyright /></>} />
    <Route path="/Login" element={<><LoginNavbar /><Register /><Copyright /></>} />
    <Route path="/Login" element={<><LoginNavbar /><Login /><Copyright /></>} />

    <Route path="/Login" element={<Login />} />
    <Route path="/Register" element={<Register />} />
    <Route path="/Password" element={<Password />} />
  </Routes>
</div>
</Router>
    );
}

export default Login;
